              'Account Protection: SIPC and Excess SIPC Coverage\nClient securities accounts at Syncextrade Financial LLC are protected by the Securities Investor Protection Corporation ("SIPC") for a maximum coverage of $500,000 (with a cash sublimit of $250,000). In addition, Syncextrade offers clients Excess SIPC coverage based on the clearing arrangement: For securities accounts under the omnibus clearing relationship with Apex, Syncextrade carries an excess SIPC policy with certain underwriters at Lloyd\'s of London, which extends per account coverage for securities and cash up to an aggregate of $100 million, subject to a maximum limit of $1,900,000 for any one customer’s cash. Securities positions are not subject to any per account sublimit. (ii) For securities accounts that are fully-disclosed to the clearing firm, Apex has purchased an additional insurance policy. The coverage limits provide protection for securities and cash up to an aggregate of $150 million, subject to maximum limits of $37.5 million for any one customer\'s securities and $900,000 for any one customer\'s cash.\nFor the purpose of determining a Syncextrade Financial LLC covered account, accounts with like names and titles are combined, but accounts with different titles are not (e.g. Individual/John Doe and IRA/John Doe). Futures and other assets held outside the securities account are not covered. SIPC and Excess SIPC Protections do not protect against a loss in the market value of securities.\nSIPC is a non-profit, membership corporation funded by broker-dealers that are members of SIPC. For more information about SIPC and answers to frequently asked questions please refer to the following websites:  (i)  <a href="http://www.SIPC.org" target="_blank" rel="nofollow noopener noreferrer">http://www.SIPC.org</a> (ii) <a href="https://www.finra.org/investors/have-problem/your-rights-under-sipc-protection=" target="_blank" rel="nofollow noopener noreferrer">https://www.finra.org/investors/have-problem/your-rights-under-sipc-protection=</a>',
