              '证券交易服务由Webull Financial LLC （微牛证券) 提供。微牛证券是美国证券交易委员会（SEC）注册的证券经纪商，美国金融业监管局（<a href="https://brokercheck.finra.org/firm/summary/289063" target="_blank" rel="nofollow noopener noreferrer">FINRA</a>）、证券投资者保护公司（<a href="https://www.sipc.org/list-of-members/?query=webull" target="_blank" rel="nofollow noopener noreferrer">SIPC</a>）、纽约证券交易所（<a href="https://www.nyse.com/markets/nyse/membership" target="_blank" rel="nofollow noopener noreferrer">NYSE</a>）、纳斯达克交易所（<a href="https://www.nasdaqtrader.com/Trader.aspx?id=Membership" target="_blank" rel="nofollow noopener noreferrer">NASDAQ</a>）和芝加哥期权交易所（<a href="https://www.cboe.com/us/equities/membership/" target="_blank" rel="nofollow noopener noreferrer">CBOE</a>）旗下EDGX证券交易所的成员公司。',
            H5_BIZ_COMP_US_0019:
              '作为SIPC的成员公司，SIPC为每位投资者的微牛证券账户提供最高达50万美元（其中现金额度25万美元）的保险。请前往 <a href="https://www.sipc.org/" target="_blank" rel="nofollow noopener noreferrer">www.sipc.org</a> 查看详细说明。',
            H5_BIZ_COMP_US_0020:
              "微牛证券的清算合作伙伴 Apex Clearing 为每一位微牛证券的客户提供一份额外的保险单。此保单用来保证客户的现金及证券安全，总额高达1.5亿美元，每位客户的最高保额为3750万美元（包含90万美元现金保护）。与 SIPC保护类似，该项额外保险并不能避免用户在证券市场交易中出现损失。",
            H5_BIZ_COMP_US_0022:
              "投资者在进行投资之前应当知晓，所有的证券投资都会面临风险，证券和任何金融产品的过往业绩不能保证未来的回报。由于市场的波动，还存在损失超过原始本金的风险。投资活动并不一定适合每一位投资者。投资组合的多样化配置可能帮助分散风险，但并不能确保收益或防止发生损失。在进行投资活动前，投资者应充分了解相关金融产品，明确知晓其潜在风险，依据自身的风险承受能力或专业投资顾问的建议理性决策。",
            H5_BIZ_COMP_US_0023:
              '期权交易涉及重大风险，并不适合所有投资者。 期权投资者可能会在短时间内面临大幅亏损，并在期权到期时遭受永久损失，且损失可能会超过初始入金金额。您需要提交期权交易开通申请，审批通过以获得期权交易资格。您开始交易期权之前，请阅读<a href="https://www.theocc.com/getmedia/dd6200a7-5982-4226-90e4-1f2d32a89911/june_2024_riskstoc.pdf" target="_blank" rel="nofollow noopener noreferrer">标准化期权特征和风险提示</a>。       ',
            H5_BIZ_COMP_US_0024:
              "微牛证券网站（www.webull.com）的任何内容均不应视为购买或出售证券、期货或其他投资产品的建议。所有历史数据及内容仅供投资者参考，不应视为对未来走势的判断依据。在进行投资活动之前，投资者应充分了解相关金融产品，明确知晓其潜在风险，依据自身的风险承受能力或专业投资顾问的建议理性决策。",
            H5_BIZ_COMP_US_0025:
              "由于交易系统的响应以及订单的执行速度受到交易量、市场状态、系统性能等因素影响，最终交易达成的结果与投资的预期可能存在差异。",
